contractGuarantee.procedureInfo:
Участник аукциона, с которым заключается государственный контракт, самостоятельно определяет способ обеспечения исполнения контракта:
- банковская гарантия, срок действия гарантии должен превышать срок действия контракта не менее чем на один месяц;
- внесение денежных средств на указанный заказчиком счет, на котором учитываются операции со средствами, поступающими заказчику.
